	function clearCookie(c_name){
		document.cookie=c_name + "=0";
	}
	
	function setCookieForSecounds(c_name,value,exsecounds){
		var exdate=new Date();
		exdate.setTime(exdate.getTime() + (exsecounds*1000) );
		var c_value=escape(value) + ((exsecounds==null) ? "" : "; expires="+exdate.toUTCString());
		document.cookie=c_name + "=" + c_value;
	}
	
	function getCookie(c_name){
		var c_value = document.cookie;
		var c_start = c_value.indexOf(" " + c_name + "=");
		if (c_start == -1){
			c_start = c_value.indexOf(c_name + "=");
		}
		if (c_start == -1) {
			c_value = null;
		}
		else{
			c_start = c_value.indexOf("=", c_start) + 1;
			var c_end = c_value.indexOf(";", c_start);
			if (c_end == -1){
				c_end = c_value.length;
			}
			c_value = unescape(c_value.substring(c_start,c_end));
		}
		return c_value;
	}
	
	paltip.cookieEnables = function(){
		var cookieEnabled = navigator.cookieEnabled;
	    if (cookieEnabled === false) {
	        return false;
	    }
	    if (!document.cookie && (cookieEnabled === null || /*@cc_on!@*/false)){
	        document.cookie = "testcookie=1";
	        if (!document.cookie) {
	            return false;
	        } else {
	            document.cookie = "testcookie=; expires=" + new Date(0).toUTCString();
	        }
	    }
	    return true;
	};
	
